import React from 'react';
import { Link } from 'react-router-dom';
import { connect } from 'react-redux';
import { logout } from '../actions/actions.auth';

const Navs2 = ({logout}) => {
  return(
    <div>
      <Link to = '/' onClick={logout}></Link>
    </div>
  )
}

export default connect(null,logout)(Navs2)
